import classes from "./Event.module.css";

const Event = (props) => {
  console.log("props", props.eventDate);
  const ist = new Date(props.eventDate);
  const getYear = ist.getFullYear();
  const getMonth = ist.getMonth();
  const getDate = ist.getDate();
  const getDay = ist.getDay();
  console.log(
    `${ist} ----- ${getYear} ----- ${getMonth} ----- ${getDate} ----- ${getDay}`
  );

  return (
    <li className={classes.event}>
      <h2>{props.eventName}</h2>
      <h3>{props.eventDesc}</h3>
      <p>{props.eventDate}</p>
    </li>
  );
};

export default Event;
